import React from "react";

import classes from "./Respaldo.module.css";
import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';
import ArrowBackIosIcon from '@material-ui/icons/ArrowBackIos';

const Respaldo = (props) => {
  return (
    <div className={classes.Respaldo}>
      <ArrowForwardIosIcon
        className={classes.ArrowRight}
        onClick={props.nextRoute}
      />
      <h2>Paso 1: Forma</h2>
      <ArrowBackIosIcon
        className={classes.ArrowLeft}
        onClick={props.prevRoute}
      />

      <div className={classes.containerRespaldo}>
        <span className={classes.altura}>Altura: 160</span>
        <div className={classes.respaldo}></div>
        <span className={classes.ancho}>Ancho: 120</span>
      </div>
    </div>
  );
};

export default Respaldo;
